  private static final String languagesValues = "\u572d\u5951\u6587\u00A6\u827e\u5361\u6731\u514b\u6587\u00A6\u4f0a\u55ac\u6587\u00A6\u73ed\u5716\u6587\u00A6\u8607\u7f8e\u6587\u00A6\u8607\u8607\u6587\u00A6\u5176\u4ed6\u8a9e\u8a00\u00A6\u6d1b\u9f4a\u6587\u00A6\u6e6f\u52a0\u6587(\u5c3c\u4e9e\u85a9\u6587)\u00A6\u6ce2\u90a3\u8c9d\u6587\u00A6\u7c73\u5357\u5361\u5821\u6587\u00A6\u8607\u5eab\u99ac\u6587\u00A6\u6c83\u723e\u592b\u6587\u00A6\u5eab\u7279\u5948\u6587\u00A6\u7c73\u514b\u99ac\u514b\u6587\u00A6\u74e6\u9686\u6587\u00A6\u5eab\u5bc6\u514b\u6587\u00A6\u85a9\u6ce2\u7279\u514b\u6587\u00A6\u5eab\u65bd\u7279\u8a9e\u7cfb\uff08\u5176\u4ed6\uff09\u00A6\u908f\u8f2f\u6587\u00A6\u591a\u683c\u4f86\u6587\u00A6\u5967\u6258\u7c73\u6587\u00A6\u8d8a\u5357\u6587\u00A6\u62c9\u7f85\u901a\u52a0\u6587\u00A6\u6eab\u9054\u6587\u00A6\u5fa9\u6d3b\u5cf6\u6587\u00A6\u62c9\u8cc8\u65af\u5766\u8af8\u6587\u00A6\u9102\u5716\u66fc\u571f\u8033\u5176\u6587 (1500-1928)\u00A6\u5c3c\u8332\u99ac\u6587\u00A6\u70cf\u8332\u5225\u514b\u6587\u00A6\u70cf\u52a0\u5217\u6587\u00A6\u5854\u99ac\u5947\u514b\u6587\u00A6\u5176\u4ed6\u5317\u7f8e\u5370\u5730\u5b89\u6587\u00A6\u7d0d\u74e6\u7279\u6587\u00A6\u70cf\u723e\u90fd\u6587\u00A6\u70cf\u514b\u862d\u6587\u00A6\u53e4\u57c3\u53ca\u6587)\u00A6\u7dad\u543e\u723e\u6587\u00A6\u82b3\u65cf\u6587\u00A6\u975e\u6d32\u6492\u54c8\u62c9\u6c99\u6f20\u908a\u7de3\u5730\u5e36\u6587\u00A6\u611b\u723e\u862d\u6587\uff0c\u4e2d\u53e4 (900-1200)\u00A6\u6ce2\u7f85\u7684\u6587\uff08\u5176\u4ed6\uff09\u00A6\u5c3c\u5967\u56c9\u6587\u00A6\u5df4\u85a9\u6587\u00A6\u5c3c\u63da\u79d1\u840a\u6587\u00A6\u5c3c\u63da\u97cb\u9f4a\u6587\u00A6\u5b5f\u6587\u00A6\u5df4\u5398\u6587\u00A6\u6b50\u585e\u5947\u6587\u00A6\u5927\u6eaa\u5730\u6587\u00A6\u7e41\u9ad4\u4e2d\u6587\u00A6\u585e\u96f7\u723e\u6587\u00A6\u7279\u6797\u57fa\u7279\u6587\u00A6\u97c3\u977c\u6587\u00A6\u73ed\u9054\u6587\u00A6\u6771\u52a0\u6587\u00A6\u7a81\u5c3c\u897f\u4e9e\u6587\u00A6\u571f\u5eab\u66fc\u6587\u00A6\u63d0\u683c\u5229\u5c3c\u4e9e\u6587\u00A6\u5eab\u9b6f\u79d1\u6587\u00A6\u6cf0\u76e7\u56fa\u6587\u00A6\u514b\u9b6f\u6587\u00A6\u5361\u8212\u5e03\u6587\u00A6\u5766\u7c73\u723e\u6587\u00A6\u6258\u514b\u52de\u6587\u00A6\u57c3\u83f2\u514b\u6587\u00A6\u53f2\u74e6\u5e0c\u91cc\u6587\u00A6\u8607\u4e39\u6587\u00A6\u5361\u62c9\u67f4-\u5305\u723e\u5361\u723e\u6587\u00A6\u585e\u723e\u7dad\u4e9e\u6587\u00A6\u963f\u723e\u5df4\u5c3c\u4e9e\u6587\u00A6\u9580\u5fb7\u6587\u00A6\u514b\u91cc\u5967\u723e\u6587\u548c\u76ae\u6b3d\u6587\u00A6\u7d22\u99ac\u5229\u6587\u00A6\u585e\u5167\u52a0\u723e\u6587\u00A6\u85a9\u6469\u4e9e\u6587\u00A6\u65af\u6d1b\u7dad\u5c3c\u4e9e\u6587\u00A6\u53e4\u5e0c\u81d8\u6587 (\u81f3 1453)\u00A6\u54e5\u535a\u8a9e\u00A6\u50e7\u4f3d\u7f85\u6587\u00A6\u585e\u723e\u7dad\u4e9e\u514b\u7f85\u57c3\u897f\u4e9e\u6587\u00A6\u514b\u91cc\u7c73\u4e9e\u534a\u5cf6\u7684\u571f\u8033\u5176\u6587\uff1b\u514b\u91cc\u7c73\u4e9e\u534a\u5cf6\u7684\u5854\u5854\u723e\u6587\u00A6\u975e\u9583\u65cf\u53ca\u975e\u4e9e\u8a9e\u8a00\u00A6\u5317\u65b9\u85a9\u7c73\u6587\u00A6\u8607\u4e39\u6587\u00A6\u6c83\u8482\u827e\u514b\u6587\u00A6\u6492\u4e01\u6587\u00A6\u76e7\u5b89\u9054\u6587\u00A6\u66fc\u9054\u6587\u00A6\u7f85\u99ac\u5c3c\u4e9e\u6587\u00A6\u91cc\u6258\u7f85\u66fc\u65af\u6587\u00A6\u63d0\u592b\u6587\u00A6\u963f\u8fea\u5404\u6587\u00A6\u7956\u5c3c\u6587\u00A6\u84cb\u4e18\u4e9e\u6587\u00A6\u8482\u683c\u96f7\u6587\u00A6\u6b50\u6d32\u8154\u8abf\u548c\u6d0b\u6d87\u6ff1\uff0c\u6e90\u81ea\u8461\u8404\u7259\u6587\u7684(\u5176\u4ed6)\u00A6\u7d22\u683c\u5e95\u4e9e\u7d0d\u6587\u00A6\u963f\u7576\u83ab\u6587\u00A6\u79d1\u65af\u96f7\u6069\u6587\u00A6\u8d6b\u68af\u6587\u00A6\u6b50\u6d32\u8154\u8abf\u548c\u6d0b\u6d87\u6ff1\uff0c\u6e90\u81ea\u6cd5\u6587\u7684(\u5176\u4ed6)\u00A6\u6b50\u6d32\u8154\u8abf\u548c\u6d0b\u6d87\u6ff1\uff0c\u6e90\u81ea\u82f1\u6587\u7684(\u5176\u4ed6)\u00A6\u8d6b\u99ac\u67e5\u5229\u6587\u00A6\u8ca2\u6839\u6587\u00A6\u5e0c\u5229\u84cb\u8fb2\u6587\u00A6\u54e5\u7279\u6587\u00A6\u79d1\u9686\u9054\u7f85\u6587\u00A6\u5ca1\u5fb7\u6587\u00A6\u52aa\u6bd4\u4e9e\u6587\u00A6\u666e\u4ec0\u5716\u6587\u00A6\u8153\u5c3c\u57fa\u6587\u00A6\u5fb7\u6587,\u4e0a\u53e4\u5168\u76db\u6642\u671f (ca.750-1050)\u00A6\u963f\u50d1\u5229\u6587\u00A6\u7464\u6587\u00A6\u5176\u4ed6\u83f2\u5f8b\u8cd3\u6587\u00A6\u4e9e\u9f4a\u6587\u00A6\u6ce2\u862d\u6587\u00A6\u5df4\u5229\u6587\u00A6\u5e03\u5409\u65af\u6587\u00A6\u65af\u79d1\u7279\u85a9\u7c73\u6587\u00A6\u5e03\u91cc\u963f\u7279\u6587\u00A6\u99ac\u8cfd\u6587\u00A6\u4f0a\u7d0d\u88e1\u85a9\u7c73\u6587\u00A6\u5357\u5cf6\u6587\u00A6\u5967\u585e\u63d0\u6587\u00A6\u6b50\u91cc\u4e9e\u6587\u00A6\u9b6f\u52d2\u85a9\u7c73\u6587\u00A6\u5176\u4ed6\u85a9\u7c73\u6587\u00A6\u671b\u52a0\u932b\u6587\u00A6\u9081\u8482\u5229\u6587\u00A6\u99ac\u52a0\u4f0a\u6587\u00A6\u5967\u6770\u5e03\u74e6\u6587\u00A6\u99ac\u90fd\u62c9\u6587\u00A6\u5357\u85a9\u7c73\u6587\u00A6\u5967\u897f\u5766\u6587\u00A6\u5384\u723e\u8332\u4e9e\u6587\u00A6\u591a\u683c\u91cc\u5e03\u6587\u00A6\u99ac\u96c5\u6587\u00A6\u5c3c\u63da\u8cc8\u6587\u00A6\u7d0d\u74e6\u7d04\u6587\u00A6\u5357\u5730\u7562\u5217\u6587\u00A6\u5fb7\u6587, \u4e2d\u53e4\u5168\u76db\u6642\u671f (ca.1050-1500)\u00A6\u65b0\u632a\u5a01\u6587\u00A6\u8377\u862d\u6587\u00A6\u6069\u6771\u52a0\u6587\u00A6\u5176\u4ed6\u65af\u62c9\u592b\u6587\u00A6\u5c3c\u6cca\u723e\u6587\u00A6\u5317\u5730\u7562\u5217\u6587\u00A6\u6cf0\u9813\u6587\u00A6\u632a\u5a01\u6ce2\u514b\u9ed8\u723e\u6587\u00A6\u8afe\u9b6f\u6587\u00A6\u6cf0\u96f7\u8afe\u6587\u00A6\u63d0\u59c6\u6587\u00A6\u7dec\u7538\u6587\u00A6\u7acb\u9676\u5b9b\u6587\u00A6\u99ac\u723e\u4ed6\u6587\u00A6\u53e4\u6ce2\u65af\u6587 (ca.600-400 B.C.)\u00A6\u99ac\u4f86\u6587\u00A6\u99ac\u62c9\u5730\u6587\u00A6\u6469\u723e\u591a\u74e6\u6587\u00A6\u7336\u592a\u6559-\u963f\u62c9\u4f2f\u6587\u00A6\u99ac\u4f86\u4e9e\u62c9\u59c6\u6587\u00A6\u99ac\u5176\u9813\u6587\u00A6\u99ac\u7d39\u723e\u6587\u00A6\u99ac\u723e\u52a0\u4ec0\u6587\u00A6\u99ac\u723e\u5c3c\u88e1\u6587\u00A6\u65af\u62c9\u592b\u00A6\u9b6f\u5df4\u52a0\u4e39\u52a0\u6587\u00A6\u5fb7\u62c9\u74e6\u00A6\u5bee\u570b\u6587\u00A6\u6797\u5821\u6587\u00A6\u4f9d\u6c6a\u90fd\u6587\u00A6\u5e72\u9054\u6587\u00A6\u76e7\u68ee\u5821\u6587\u00A6\u7336\u592a\u6559-\u6ce2\u65af\u6587\u00A6\u5176\u4ed6\u6f22\u85cf\u6587\u00A6\u5409\u723e\u5409\u65af\u6587\u00A6\u5eb7\u74e6\u8033\u6587\u00A6\u5eab\u723e\u5fb7\u6587\u00A6\u5927\u8607\u6587\u00A6\u514b\u4ec0\u7c73\u723e\u6587\u00A6\u5361\u52aa\u88e1\u6587\u00A6\u97d3\u6587\u00A6\u574e\u90a3\u9054\u6587\u00A6\u9ad8\u68c9\u6587\u00A6\u683c\u9675\u862d\u6587\u00A6\u54c8\u85a9\u514b\u6587\u00A6\u5ee3\u4e9e\u99ac\u6587\u00A6\u5409\u666e\u8cfd\u6587\u00A6\u5e0c\u9054\u6469\u6587\u00A6\u5409\u5eab\u5c24\u4eba\u00A6\u525b\u679c\u6587\u00A6\u53e4\u8afe\u723e\u65af\u6587\u00A6\u55ac\u6cbb\u4e9e\u6587\u00A6\u514b\u91cc\u514b\u6587\u00A6\u5176\u4ed6\u7f85\u66fc\u6587\u00A6\u8afe\u84cb\u6587\u00A6\u8499\u9054\u6587\u00A6\u591a\u7a2e\u8a9e\u8a00\u00A6\u5409\u723e\u4f2f\u7279\u7fa4\u5cf6\u6587\u00A6\u8d0a\u5fb7\u6587\u00A6\u64a3\u6587\u00A6\u8c50\u6587\u00A6\u5361\u723e\u6885\u514b\u6587\u00A6\u6fb3\u6d32\u82f1\u6587\u00A6\u548c\u95d0[\u8207\u95d0]\u6587\u00A6\u5e1b\u7409\u6587\u00A6\u6c99\u4f0a\u5b89\u6587\u00A6\u56e0\u7d10\u7279\u6587\u00A6\u7fa9\u5927\u5229\u6587\u00A6\u5e15\u76ae\u963f\u9580\u6258\u6587\u00A6\u624b\u8a9e\u00A6\u51b0\u5cf6\u6587\u00A6\u67f4\u7f85\u57fa\u6587\u00A6\u6f58\u5e15\u5609\u6587\u00A6\u5df4\u5217\u7dad\u6587\u00A6\u5947\u4f69\u74e6\u63da\u6587\u00A6\u4f0a\u6717\u6587\u00A6\u55ac\u514b\u6258\u6587\u00A6\u5951\u5974\u514b\u6587\u00A6\u99ac\u91cc\u6587\u00A6\u571f\u51e1\u6587\u00A6\u73ed\u5716\u6587\u00A6\u4f9d\u5974\u76ae\u7dad\u514b\u6587\u00A6\u6f58\u52a0\u8f9b\u6587\u00A6\u8655\u5947\u65af\u6587\u00A6\u56db\u5ddd\u8a71\u00A6\u862d\u5df4\u6587\u00A6\u4f0a\u5e03\u6587\u00A6\u53e4\u611b\u723e\u862d\u6587\uff08\u81f3 900\uff09\u00A6\u62c9\u4e01\u570b\u969b\u6587\u00A6\u5176\u4ed6\u5df4\u5e03\u4e9e\u8af8\u8a9e\u8a00\u00A6\u5370\u5c3c\u6587\u00A6\u62c9\u4ea8\u9054\u6587\u00A6\u8fea\u96c5\u514b\u6587\u00A6\u5947\u5e03\u67e5\u6587\u00A6\u62c9\u4e01\u570b\u969b\u6587\u00A6\u62c9\u8fea\u8afe\u6587\u00A6\u8d6b\u96f7\u7f85\u6587\u00A6\u6d77\u9054\u6587\u00A6\u9054\u723e\u683c\u74e6\u6587\u00A6\u4e9e\u7f8e\u5c3c\u4e9e\u6587\u00A6\u963f\u85a9\u5df4\u65af\u5361\u6587\u00A6\u6d77\u5730\u4eba\u00A6\u9054\u79d1\u4ed6\u6587\u00A6\u514b\u7f85\u57c3\u897f\u4e9e\u6587\u00A6\u897f\u91cc\u83ab\u5716\u571f\u6587\u00A6\u5317\u5370\u5ea6\u6587\u00A6\u5e0c\u4f2f\u4f86\u6587\u00A6\u963f\u65af\u5716\u91cc\u4e9e\u6587\u00A6\u6587\u5fb7\u6587\u00A6\u66fc\u5cf6\u6587\u00A6\u5409\u4e9e\u62c9\u5854\u6587\u00A6\u5176\u4ed6\u9583\u65cf\u8a9e\u8a00\u00A6\u6613\u6d1b\u9b41\u6587\u00A6\u745f\u723e\u5361\u666e\u6587\u00A6\u52a0\u91cc\u897f\u4e9e\u6587\u00A6\u5409\u8332\u6587\u00A6\u5176\u4ed6\u4eba\u5de5\u8a9e\u8a00\u00A6\u8607\u683c\u862d - \u84cb\u723e\u6587\u00A6\u4f0a\u82b3\u6717\u6587\u00A6\u611b\u723e\u862d\u6587\u00A6\u963f\u52de\u574e\u6587\u00A6\u5f17\u91cc\u65af\u862d\u6587\u00A6\u932b\u514b\u932b\u5361\u6587\u00A6\u5fb7\u570b\u7684(\u5176\u4ed6)\u00A6\u611b\u65af\u57fa\u6469\u6587\u00A6\u6cd5\u7f85\u6587\u00A6\u514b\u723e\u7279\u6587\uff08\u5176\u4ed6\uff09\u00A6\u6590\u6fdf\u6587\u00A6\u82ac\u862d\u6587\u00A6\u5bcc\u62c9\u6587\u00A6\u5410\u74e6\u9b6f\u6587\u00A6\u5bbf\u52d9\u65cf\u6587\u00A6\u611b\u6c99\u5c3c\u4e9e\u6587\u00A6\u4e16\u754c\u8a9e\u00A6\u5e0c\u81d8\u6587\u00A6\u5176\u4ed6\u963f\u723e\u6cf0\u8af8\u6587\u00A6\u7d10\u57c3\u6587\u00A6\u5716\u76ae\u6587\u00A6\u57c3\u7def\u6587\u00A6\u5716\u59c6\u5e03\u5361\u6587\u00A6\u5176\u4ed6\u5c3c\u65e5\u525b\u679c\u8a9e\u7cfb\u00A6\u76e7\u6652\u6587\u00A6\u82ac\u862d-\u70cf\u6208\u723e\u65cf\u6587(\u5176\u4ed6)\u00A6\u8fea\u7dad\u897f\u6587\u00A6\u5c3c\u4e9e\u65af\u6587\u00A6\u83ab\u970d\u514b\u6587\u00A6\u76e7\u5967\u6587\u00A6\u76e7\u6069\u9054\u6587\u00A6\u963f\u5e15\u5947\u8a9e\u8a00\u00A6\u8def\u6613\u585e\u8afe\u6587\u00A6\u9b6f\u5df4\u9b6f\u9b6f\u4e9e\u6587\u00A6\u6bd4\u79d1\u723e\u6587\u00A6\u74e6\u7d39\u6587\u00A6\u672a\u78ba\u5b9a\u7684\u00A6\u74e6\u745e\u6587\u00A6\u4e39\u9ea5\u6587\u00A6\u8377\u862d\uff0c\u4e2d\u53e4 (ca. 1050-1350)\u00A6\u99ac\u8afe\u6ce2\u6587\u00A6\u5938\u57fa\u6b66\u7279\u6587\u00A6\u6563\u5854\u5229\u6587\u00A6\u5a01\u723e\u58eb\u6587\u00A6\u6492\u6492\u514b\u6587\u00A6\u5361\u5df4\u723e\u9054\u6587\u00A6\u695a\u74e6\u751a\u6587\u00A6\u66fc\u5c3c\u666e\u88e1\u6587\u00A6\u85a9\u746a\u5229\u4e9e\u963f\u62c9\u59c6\u6587\u00A6\u514b\u88e1\u6587\u00A6\u85a9\u5229\u751a\u6587\u00A6\u675c\u4e9e\u62c9\u6587\u00A6\u6eff\u65cf\u6587\u00A6\u96c5\u5eab\u7279\u6587\u00A6\u845b\u5df4\u4e9e\u6587\u00A6\u6851\u9054\u97cb\u6587\u00A6\u67e5\u83ab\u6d1b\u6587\u00A6\u5370\u6b50\u8a9e\u7cfb\uff08\u5176\u4ed6\uff09\u00A6\u535a\u5091\u666e\u723e\u6587\u00A6\u82f1\u6587\uff0c\u4e2d\u4e16\u7d00 (1100-1500)\u00A6\u514b\u502b\u6587\u00A6\u5370\u5ea6\u8a9e\u7cfb\uff08\u5176\u4ed6\uff09\u00A6\u8eca\u81e3\u6587\u00A6\u52a0\u7d04\u6587\u00A6\u52a0\u6cf0\u7f85\u5c3c\u4e9e\u6587\u00A6\u59c6\u672c\u675c\u6587\u00A6\u53e4\u6558\u5229\u4e9e\u6587\u00A6\u6b3d\u897f\u5b89\u6587\u00A6\u53e4\u82f1\u6587 (ca.450-1100)\u00A6\u9ad8\u52a0\u7d22\u6587\uff08\u5176\u4ed6\uff09\u00A6\u5361\u6bd4\u723e\u6587\u00A6\u5361\u62c9\u5361\u723e\u5e15\u514b\u6587\u00A6\u6ce2\u58eb\u5c3c\u4e9e\u6587\u00A6\u85cf\u6587\u00A6\u52a0\u65cf\u6587\u00A6\u4e2d\u7f8e\u5370\u7b2c\u5b89\u6587\uff08\u5176\u4ed6\uff09\u00A6\u6bd4\u65af\u62c9\u99ac\u6587\u00A6\u6bd4\u54c8\u723e\u6587\u00A6\u4fdd\u52a0\u5229\u4e9e\u6587\u00A6\u767d\u4fc4\u7f85\u65af\u6587\u00A6\u5df4\u4ec0\u5ba2\u723e\u6587\u00A6\u7956\u9b6f\u6587\u00A6\u6fa4\u7d0d\u52a0\u6587\u00A6\u666e\u7f85\u6587\u65af\u6587 (to 1500)\u00A6\u4e9e\u585e\u62dc\u7136\u6587\u00A6\u827e\u99ac\u62c9\u6587\u00A6\u963f\u6cd5\u6587\u00A6\u963f\u85a9\u59c6\u6587\u00A6\u4e0b\u7d22\u5e03\u6587\u00A6\u4f0a\u6d1b\u95ca\u6587\u00A6\u57c3\u862d\u6587\u00A6\u963f\u62c9\u8ca2\u6587\u00A6\u5370\u5ea6\u53e4\u4ee3\u53ca\u4e2d\u4e16\u7d00\u4e4b\u4e2d\u90e8\u53ca\u5317\u90e8\u65b9\u8a00\u00A6\u5c3c\u74e6\u723e\u6587\u00A6\u963f\u574e\u6587\u00A6\u58ef\u6587\u00A6\u5357\u975e\u8377\u862d\u6587\u00A6\u963f\u7def\u65af\u9640\u6587\u00A6\u963f\u5e03\u54c8\u897f\u4e9e\u6587\u00A6\u7d04\u9b6f\u5df4\u6587\u00A6\u963f\u723e\u5ca1\u6606\u6587\u00A6\u963f\u7559\u7533\u6587\u00A6\u5176\u4ed6\u9ad8\u68c9\u8a9e\u7cfb\u00A6\u610f\u7b2c\u7dd2\u6587\u00A6\u5fb7\u62c9\u5a01\u6587\uff08\u5176\u4ed6\uff09\u00A6\u67cf\u67cf\u723e\u6587\u00A6\u5fb7\u570b\u5317\u90e8\u7684\u5fb7\u6587; \u85a9\u514b\u905c\u6587\u00A6\u5225\u59c6\u5df4\u6587\u00A6\u8c9d\u624e\u6587\u00A6\u6258\u6bd4\u8f9b\u6587";

